('18', 1, 1, 'Just finished greenhorn arena and the doors would not let me through.\r\n\r\nThe doors kick me back out so I will miss out on rewards. \r\n\r\nI\'d appreciate if you could send those rewards to me \"The Uncle Two\"\r\nor take me to that room when we both online again. \r\n\r\nCheers, \r\nThe Uncle', 1, 'Svargrond arena doors to rewards', 0, 0, 1, 6),
('40', 1, 1, 'Guys, please check the attack speed, the normal attack. It\'s taking ages to character attack properly, I\'m pretty sure that is slower than the global.\r\n\r\nThx', 1, 'Attack Speed', 0, 0, 2, 3);
