(3, 'Online!', '<h1><strong>Exon is live!</strong></h1>\r\n<p>-Tibia 12 Client</p>\r\n<p>-Real Tibia Map</p>\r\n<p>-Additional Custom NPCs</p>\r\n<p>-Custom Town (Vanguard)</p>\r\n<p>-Portal Room</p>\r\n<p>-Autoloot</p>', 1, 1585919321, 2, 39, 39, 1585919467, '0', '', 'images/news/announcement.jpg', 0);
