INSERT INTO `myaac_pages` (`id`, `name`, `title`, `body`, `date`, `player_id`, `php`, `enable_tinymce`, `access`, `hidden`) VALUES
(1, 'downloads', 'Downloads', '<p> </p>\r\n<p> </p>\r\n<div style=\"text-align: center;\">We\'re using the official Tibia Client <strong>12.</strong><br />\r\n<p>Download the Exon Client for Windows <a href=\"https://drive.google.com/open?id=19snY21pyEhXm-UsacEhP97TtIBTyIDId\" target=\"_blank\" rel=\"noopener\">HERE</a>.</p>\r\n</div>', 0, 1, 0, 1, 1, 0),
(2, 'commands', 'Commands', '<table style=\"border-collapse: collapse; width: 87.8471%; height: 57px;\" border=\"1\">\r\n<tbody>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 33.3333%; background-color: #505050; height: 18px;\"><span style=\"color: #ffffff;\"><strong>Words</strong></span></td>\r\n<td style=\"width: 33.3333%; background-color: #505050; height: 18px;\"><span style=\"color: #ffffff;\"><strong>Description</strong></span></td>\r\n</tr>\r\n<tr style=\"height: 18px; background-color: #f1e0c6;\">\r\n<td style=\"width: 33.3333%; height: 18px;\"><em>!online</em></td>\r\n<td style=\"width: 33.3333%; height: 18px;\">Shows players online.</td>\r\n</tr>\r\n<tr style=\"height: 18px; background-color: #d4c0a1;\">\r\n<td style=\"width: 33.3333%; height: 18px;\"><span style=\"background-color: #d4c0a1;\"><em>!buyhouse</em></span></td>\r\n<td style=\"width: 33.3333%; height: 18px;\">Buy the house you are looking at.</td>\r\n</tr>\r\n<tr style=\"height: 18px; background-color: #f1e0c6;\">\r\n<td style=\"width: 33.3333%; height: 18px;\"><em>!sellhouse</em></td>\r\n<td style=\"width: 33.3333%; height: 18px;\">Sell your house.</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #d4c0a1;\"><span style=\"background-color: #f1e0c6;\"><em>!autoloot add, itemname</em></span></td>\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #d4c0a1;\">Add an item to your autoloot list.</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #f1e0c6;\"><span style=\"background-color: #f1e0c6;\"><em>!autoloot remove, itemname</em></span></td>\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #f1e0c6;\">Remove an item from your autoloot list.</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #d4c0a1;\"><span style=\"background-color: #f1e0c6;\"><em>!autoloot show</em></span></td>\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #d4c0a1;\">Show your autoloot list.</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #f1e0c6;\"><span style=\"background-color: #f1e0c6;\"><em>!autoloot clear</em><em><br /></em></span></td>\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #f1e0c6;\">Clear your autoloot list.</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #d4c0a1;\"><span style=\"background-color: #f1e0c6;\"><em>!bless</em></span></td>\r\n<td style=\"width: 33.3333%; height: 18px; background-color: #d4c0a1;\">Buy all blessings with gold from your backpack.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>', 0, 1, 0, 1, 1, 0);
